window.bookSummaryJSON = "<p><b>Galaxy’s Edge, Season 2 continues as a divided galaxy is navigated by heroes forced to chart their own dangerous courses....</b></p> <p>The darkest secrets stay hidden.</p> <p>Wraith, seeking to acquire intel on the mysterious Kill Team Ice, finds himself teamed up with an unlikely Nether Ops ally. Zora and Garret, in pursuit of a lost friend, will have their loyalty to Captain Keel tested. And the strain on Nilo and Black Leaf continues to grow, with unexpected intensity.</p> <p>For all of them, the path forward is a crooked one, weaving through House of Reason loyalists, Bronze Guild bounty hunters, brutal slavers, Legion operators, and the mysteries now emerging from the empty and foreboding space beyond galaxy’s edge. And each step along that path only seems to reveal a new, darker truth about what’s coming for them.</p> <p>But one thing is increasingly certain. War is brewing.</p> <p><b>Includes a special author's note.</b></p>"; 
